import React from "react";
import { BrowserRouter as Routes, Switch, Route,Router
} from "react-router-dom";


import Home from "./Home";

function App() {
  return (
    // <Home/>
    <Router>
      <Routes>
        <Route to="/" component={Home} />
      </Routes>
    </Router>
  );
}

export default App;
